from functools import lru_cache
@lru_cache(maxsize=None)
def a(n: int) -> int:
    if n < 2: return 1
    b = 1 << ((n - 1).bit_length() - 1)
    f = min(b, n - b // 2)
    return a(f) * n * a(n - f)
print([a(n) for n in range(1, 27)])  # after _Alois P. Heinz_, _Peter Luschny_, Aug 19 2025

